            _name,
            _applicantAddress,
            _medicalId,
            _applicantType
        );

        return requestId;
    }

    function fulfill(bytes32 _requestId, uint256 _verification)
        public
        recordChainlinkFulfillment(_requestId)
    {
        Applicant memory applicant = Applicants[_requestId];
