            if (applicant.applicantType == 0) {
                addAuthorizedDoctor(
                    applicant.applicantAddress,
                    applicant.name,
                    applicant.medicalId
                );
            } else {
                addAuthorizedHospital(
                    applicant.applicantAddress,
                    applicant.name,
                    applicant.medicalId
                );
            }
